class GetAppsParams(
    val category: String,
    val collection: Collection = Collection.TOP_FREE,
    val language: String = DefaultParams.LANGUAGE,
    val country: String = DefaultParams.COUNTRY,
    val limit: Int = DefaultParams.LIMIT
)

internal class GetAppsRequest(
    private val params: GetAppsParams,
    private val baseUrl: String,
    private val httpClient: OkHttpClient,
    private val requestResultParser: ResultParser<String, PagedResult<List<App>>>
) : Request<List<App>> {

    override fun execute(): Response<List<App>, ScraperError> = response {
        val response = executeRequest()

        if (response.isSuccessful) {
            response.requireBody()
                .string()
                .let(requestResultParser::parse)
                .result
        } else {
            throw httpError(response)
        }
    }

    private fun executeRequest(): OkHttpResponse {
        return OkHttpRequest.Builder()
            .url(createRequestUrl())
            .post(createRequestBody())
            .build()
            .let(httpClient::newCall)
            .execute()
    }

    private fun createRequestUrl(): String {
        return buildString {
            append(baseUrl).append("/_/PlayStoreUi/data/batchexecute")
            append("?rpcids=vyAe2")
            append("&source-path=%2Fstore%2Fapps")
            append("&f.sid=-4178618388443751758")
            append("&bl=boq_playuiserver_20220612.08_p0")
            append("&authuser=0")
            append("&soc-app=121")
            append("&soc-platform=1")
            append("&soc-device=1")
            append("&_reqid=82003")
            append("&rt=c")
            append("&hl=").append(params.language)
            append("&gl=").append(params.country)
        }
    }

